const fs = require('fs')

const PlaylistParser = (data, type) => {
    var result = '';
    if (type === 'Playlist') {
        result += `PLAYLIST: ${dat.name}\n`;
        result += `Owner: ${dat.owner.name}\n`;
        result += `Number of songs: ${dat.tracks.total}\n`;
        result += `TRACKS:\n`;
        
        for (var i = 0; i < dat.tracks.total; ++i)
            result += `\t${i+1}. ${dat.tracks.items[i].track.name}`;

        ClearTempFile();
        console.log(result);
        return result;
    }
    else if (type === 'MP3') {
        // TODO: play or download preview music
    }

    else 
        console.log('JsonParser: wrong type decleration!');
}

const ClearTempFile = () => fs.writeFile("./temp/temp.txt", '', (err) => {
    if (err) { console.error(err); return }
    console.log("Clearing temp file...")
});

